import React from 'react'

const NavBar = ({filterItem,menuList}) => {
    return (
        <>
        <nav className="navbar">
        <div className="btn-group">

          <button className='btn-group__item' onClick={ ()  =>  filterItem(menuList)}> Breakfast</button>
        </div>
      </nav>
        </>
    )
}

export default NavBar
